import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Links = props => {
  return (
    <ButtonGroup size="lg">
      <Button>Find a Wellvana Provider</Button>
      <Button>Right</Button>
    </ButtonGroup>
  );
};

export default Links;
